import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const HomeIcons = () => {
    return (
        <View style={styles.h_icons}>
            <View style={styles.h_flex}>
                <Image source={require("../../assets/hd.png")} style={styles.h_img} />
                <Text>Home</Text>
            </View>
            <View style={styles.h_flex}>
                <Image source={require("../../assets/hd.png")} style={styles.h_img} />
                <Text>Home</Text>
            </View>
            <View style={styles.h_flex}>
                <Image source={require("../../assets/hd.png")} style={styles.h_img} />
                <Text>Home</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    h_icons: {
        width: '100vw',
        backgroundColor: "#f0f0f0",
        // display:'inline-block'
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
    },
    h_flex: {
        width:'95vw',
        padding:'10px',
        margin:'auto',
        backgroundColor:"#ccc"
    },
    h_img: {
        width: '50px',
        height: '50px',
        borderRadius: '50%'
    }

})

export default HomeIcons;
